const project01 = {
  title: "Fully Connected Neural Network from Scratch",
  image: "./images/projects/project01/fnn2.png",
  explanation:
    "U-Net is a network for semanitc segmentation. With this network we try to segment data of Camvid dataset and a significant result on it. Our final accuracy after 30 epochs of training was 82.3%.",
  paper: null,
  github:
    "https://github.com/ahedayat/MNIST-digit-classification-task-using-PyTorch"
};
export default project01;
